import React from 'react';

function TodoItem(props) {
    return (
      <li class="todo-item" onClick={props.handleItem}>
        <span class="item-title font">
          {props.value}
        </span>
        <button id="trash-button" onClick={props.handleTrash}>
          Trash
        </button>
      </li>
    );
  }

  export default TodoItem;
